@huffman_dave I'm with you. But I think Wentz has lost all mobility. Meaning, he can't do the rollouts and waggles that Heinicke can. 

So he's more susceptible to get sacked. 

But ultimately I agree with you. The OL simply can't sit back and block. Not talented enough.

